// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/access/Ownable.sol";

contract SubastasSCBA is Ownable {


  struct Lote {
    uint FechaInicio;
    uint FechaFin;
    uint ValorBase;
    uint FechaFinExt;
    uint cant_extensiones;
    address winner;
    uint tramo_ganador;
  }
  struct Subasta {
    string codigo_subasta;
    /*
    Tipo subasta
    0 - Mieble
    1 - Inmueble
    2 - Mieble Registrable
    */
    uint tipo_de_subasta;
    uint DepositoGarantia;
    uint CantidadLotes;
  }

  // Lotes de la subasta, si es inmuble hay un unico Lote
  Lote[] private lotes;
  /*
  Estado Subasta
  0 - No Inicializada
  1 - Inicializada
  2 - Lotes definidos
  3 - Iniciada
  4 - Extendida
  5 - Finalizada
  */
  uint estado_subasta;

  Subasta private obj_subasta;
  uint private ultimo_lote;
  constructor () {
    estado_subasta = 0;
  }
  //Deberia ser solo llamada por el owner (ver mas adelante)

  function get_estado_subasta() public view returns(uint) {
    return estado_subasta;
  }

  function InitSubasta(string memory _codigo_subasta,uint _tipo_subasta, uint _deposito_garantia, uint _cant_lotes) public onlyOwner  {
    require(estado_subasta  == 0, "La subasta ya fue inicialiada");

    estado_subasta = 1;
    obj_subasta.codigo_subasta = _codigo_subasta;
    obj_subasta.tipo_de_subasta = _tipo_subasta;
    obj_subasta.DepositoGarantia = _deposito_garantia;
    obj_subasta.CantidadLotes = _cant_lotes;
  }
  //Deberia ser solo llamada por el owner (ver mas adelante)
  function AgregaLote(uint _fecha_inicio, uint _fecha_fin, uint _valor_base) public onlyOwner {
    require(estado_subasta == 1 || estado_subasta == 2,"La subasta debe estar inciada");
    if (obj_subasta.tipo_de_subasta == 0 && lotes.length == 1) { revert(); }
    estado_subasta = 2;
    Lote memory tmpLote;
    tmpLote.cant_extensiones = 0;
    tmpLote.FechaInicio = _fecha_inicio;
    tmpLote.FechaFin = _fecha_fin;
    tmpLote.FechaFinExt = _fecha_fin;
    tmpLote.tramo_ganador = 0;
    tmpLote.ValorBase = _valor_base;

    lotes.push(tmpLote);

  }  

}
